  false,\n\t\"url\": null,\n\t\"notes\": \"This is an unpublished report of the results
  of a statewide marshbird survey conducted in South Carolina during the breeding
  season of 1991. Breeding surveys were conducted statewide from May through August,
  with efforts concentrated on public state and federal coastal waterfowl management
  areas (WMA's) that provided approximately 160,000 acres of marshland habitat between
  7 localities. All marsh birds seen or heard were counted; a running tally of birds
  recorded was kept for sites with multiple visits and some birds were undoubtedly
  counted more than once . To provide comparisons between areas with unequal survey
  points, figures were converted to survey points per bird, a relative density figure.The
  number of birds per visit to each area was also calculated. Survey routes at waterfowl
  management areas were selected based on accessibility and representation of a range
  of wetland habitats; that included watered and dewatered impoundments, brackish,
  saline, and freshwater marsh, open water, and marshlands with varied vegetative
  structure and species composition.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
